        private IDbUser dbu;

        public TestDbAssignment()
        {
            _db = new SqlConnection(HildurConnectionString.ConnectionString);
            dba = new DbAssignment();
            dbu = new DbUser();
        }

        [Test]
        public void TestConnection()
        {
            _db.Open();
            Console.WriteLine(_db.State);

            Assert.AreEqual(_db.State, ConnectionState.Open);
            _db.Close();

            Console.WriteLine(_db.State);

        }

        [Test]
        public void TestCreateAssignment()
        {
            List<User> users = dbu.GetAllUsers();

            int length1 = dba.GetAllAssignments().Count;
            DateTime now = DateTime.UtcNow;

            Assignment assignment = new Assignment();
            
            assignment.Title = "Test title";
            assignment.Description = "Assignment description";
            assignment.Price = 10;
            assignment.PostDate = now;
            assignment.Deadline = now.AddDays(5);
            assignment.Anonymous = true;
            assignment.AcademicLevel = "University";
            assignment.Subject = "Computer Science";
            assignment.UserId = users[0].Id;

            dba.CreateAssignment(assignment);


            int length2 = dba.GetAllAssignments().Count;

            Assert.IsTrue(length2 > length1);
        }



        [Test]
        public void TestGetAll()
        {
            List<Assignment> listOfItems = dba.GetAllAssignments();
            int numberOfItems = 0;
            if (listOfItems is List<Assignment>)
            {
                numberOfItems = listOfItems.Count;
            }

            Assert.IsTrue(numberOfItems>0);
        }

        [Test]
        public void TestGetById()
        {
            List<Assignment> listOfItems = dba.GetAllAssignments();
            int length = listOfItems.Count;

            int id = listOfItems[length - 1].AssignmentId;

            Assignment assignment = dba.GetByAssignmentId(id);
            Console.WriteLine("" + assignment.AssignmentId, assignment.Description);

            Assert.AreEqual(assignment.AssignmentId, id);
        }

        [Test]
        public void TestUpdateConcurrency()
        {
            List<Assignment> listOfItems = dba.GetAllAssignments();
            int id = listOfItems[0].AssignmentId;
            DateTime tomorrow = DateTime.Today.AddDays(1);
            DateTime dayAfterTomorrow = DateTime.Today.AddDays(2);


            Assignment assignment = dba.GetByAssignmentId(id);
            assignment.Deadline = dayAfterTomorrow;
            dba.UpdateAssignment(assignment, id);

            assignment.Deadline = tomorrow;
            dba.UpdateAssignment(assignment, id);


            Assignment newAssignment = dba.GetByAssignmentId(id);

            Assert.AreEqual(newAssignment.Deadline, dayAfterTomorrow);
        }

        [Test]
        public void TestDelete()
        {
            #region Arrange
            DateTime now = DateTime.UtcNow;
            List<User> users = dbu.GetAllUsers();
            Assignment assignment = new Assignment();

            assignment.Title = "Test title";
            assignment.Description = "Assignment description";
            assignment.Price = 10;
            assignment.PostDate = now;
            assignment.Deadline = now.AddDays(5);
            assignment.Anonymous = true;
            assignment.AcademicLevel = "University";
            assignment.Subject = "Computer Science";
            assignment.UserId = users[0].Id;


            #endregion

            int id = dba.CreateAssignment(assignment);

            int noOfRowsAffected = dba.DeleteAssignment(id);
            Assert.AreEqual(noOfRowsAffected, 1);
        }


